import React from 'react';
import PropTypes from 'prop-types';

import '../../styles/ElectionModal.css';
import '../../styles/ElectionModalReviewPage.css';

const propTypes = {
    election: PropTypes.object,
    selectedOption: PropTypes.number
};

const defaultProps = {
    election: {},
    selectedOption: null
};

function ElectionModalReviewPage(props) {
    const {
        election,
        selectedOption
    } = props;

    const animation = election ? " animate-review-in" : ""; 
    console.log(animation);

    return (
        <div className={`election-modal-review-page-container ${animation}`}>
            <div className="election-modal-review-title">
                Review Your Vote
            </div>
        </div>
    );
}

ElectionModalReviewPage.propTypes = propTypes;
ElectionModalReviewPage.defaultProps = defaultProps;
export default ElectionModalReviewPage;
